Bazı şeylerin üstesinden gelemeyeceğim hissine kapıldığımda;

Annemi defnettiklerinde üzerinin ne kadar hızlı örtüldüğünü anımsıyorum.

Hem en uzun gündü hem de gözümde canlandıramayacağım kadar kısa...

Allah'a;

Güzel insanlarla olmak istiyorum diye dua edin...

Dua'nızın kabul olduğunu yanlış insanlar hayatınızdan çıkınca anlayacaksınız...

Allah'ım;

Bizlere bu karanlık gecenin sabahını görmeyi nasip eylediğin gibi, zulmet karanlığının ardındaki bahar günlerini de en yakın zamanda görmeyi nasip eyle...

Günaydın 🌞🌼

@gokhanozbek Ömer Faruk Gergerlioğlu @gergerliogluof
Sezgin Tanrıkulu @MSTanrikulu
Züleyha Gülüm @zuleyhagulum

Allah'ım;

Açmayacak bir bahçeyi sulayarak, açılmayacak bir kapıyı bekleyerek ömrümüzü boşa geçirmemize izin verme...

Mutlu ve huzurlu günler ☀️🌼

Duam;

Bu bayram, zulmün gölgesinde geçireceğimiz son bayram olsun.

Herkese Hayırlı Bayramlar 💐

Duam;

Bu ifritten günlerin biteceği o son güne kadar, Allah bizlere dayanma gücü versin...

Günaydın 🌸☀️

ALLAH'IM;

Omuzlarımız çöktü, belimiz kırılmak üzere, gönüllerimiz paramparça. Sinelerimizde yanan ateşi söndürmekte zorlanıyoruz. Düğüm düğüm boğazlar ve yürekler...

Yetiş imdadımıza, en kısa zamanda  NUSRETİNİ gönder bizlere ne olur...

